import React from 'react';
import Movie from '../components/Movie';
import { movies } from '../movieDummy';

export default function MovieDetail() {
  return (
    <div>
      <div>
        return(
        {movies.results.map((movie) => {
          <Movie title={movie.title} poster_path={movie.poster_path} />;
        })}
        );
      </div>
    </div>
  );
}
